      SELECT DISTINCT - col0 / + 71 + + col2 * - col2 * ( - + col0 ) AS col1, + col0 + + 29 + - col0 * + - 89 * col0 * col1 + - col1 FROM tab2 (FORMAT parquet) WHERE NULL <> NULL;
  - name: tab2

outputs:
  - name: q267.out
    data: |
